import logo from './logo.svg';
import './App.css';
import RegS from './components/RegS';


const myarr=[1,35,67];

const anime = [{
    name:"Naruto",
    skill:"Rasengan",
    level:10
},{
    name:"Luffy",
    skill:"Jet Bazooka",
    level:13
}];

const App=()=> {
  return (
    <div className="App">
      { anime.m  }
      <RegS anime={anime[0]}></RegS>
      <RegS anime={anime[1]}></RegS>
    </div>
  );
}

export default App;
